import "./index.css";
import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import LiveRoomPage from "./components/room/LiveRoomPage";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LiveRoomPage />} />
      </Routes>
      <LiveRoomPage />
    </BrowserRouter>
  );
}

export default App;
